import React from "react";
import "./Style.css";
import { NavLink } from "react-router-dom";

const Navbar = () => {
  return (
    <>
      <NavLink to="/" activeClassName={active_class}>
        About
      </NavLink>
      <NavLink to="/contact" activeClassName={active_class}>
        Contact
      </NavLink>
    </>
  );
};

export default Navbar;
